import React from 'react';
import { Redirect, Route } from 'react-router-dom';
import {
  IonIcon,
  IonLabel,
  IonPage,
  IonRouterOutlet,
  IonTabBar,
  IonTabButton,
  IonTabs,
  IonToolbar
} from '@ionic/react';
import { ellipse, square, triangle } from 'ionicons/icons';
import Tab1 from '../components/Tab1';
import Tab2 from '../components/Tab2';
import Tab1Detail from '../components/Tab1Detail';
import Tab3 from '../components/Tab3';
import TopNav from '../components/TopNav';
import ProgrammeTalksTab from './ProgrammeTalksTab';
// import Tab1Detail from './Tab1Detail';


const ProgrammeTalks: React.FC = () => {
        return (
            <IonPage>
                <TopNav title="My Schedule" route='/u/home' backarrow={ false } hamburger = { true }/>
                <ProgrammeTalksTab />
            </IonPage>
        );
};

export default ProgrammeTalks;
